import { Flex, Container, Box, Stack, Typography, Card, Divider, CardMedia, Grid } from "@mui/material";
import image from './images/image5.png';
import DevOps from './images/DevOps.png';
import { useSpring, animated, useScroll } from '@react-spring/web';

const commonCardStyle = {
  bgcolor: 'cyan',
  height: '300'
}

const MazeGameCard = (
    <Card sx={commonCardStyle}>
      <Typography sx={{ fontSize: 20 }} color="text.primary" gutterBottom>
        Maze Game
      </Typography>
      <Divider />
      <Box>
        <CardMedia
            component="img"
            alt="Project Image"
            src={image}
            style={{
              objectFit: "cover",
              width: "100%",
              height: "100%",
            }}
          />
      </Box>
    </Card>
);

const DevOpsCard = (
  <Card sx={commonCardStyle}>
    <Typography sx={{ fontSize: 20 }} color="text.primary" gutterBottom>
      Dev Ops
    </Typography>
    <Divider />
    <CardMedia
      component="img"
      alt="Project Image"
      src={DevOps}
      style={{
        objectFit: "cover",
        width: "100%",
        height: "100%",
      }}
    />
  </Card>
);
const data = [
  {
    id: 1,
    from: {
      backgroundColor: '#E6E6FA',
      width: '10px',
    },
    to: {
      backgroundColor: '#EE82EE',
      width:'200px',
    }
    }
];
function Projects() {
  const { scrollYProgress } = useScroll()
  return (
    <animated.div style={{ opacity: scrollYProgress, color: "white" }}>
      console.log(scrollYProgress);
    </animated.div>
